                    flipDirection="horizontal"
                    ref={(r) => this.flippy = r}
                    style={{ width: '200px', height: '200px' }}
                >
                <FrontSide
      style={{
        backgroundColor: '#41669d',
      }}
    >
      RICK
    </FrontSide>
    <BackSide
      style={{ backgroundColor: '#175852'}}>
      ROCKS
    </BackSide>
  </Flippy>


          );
    }
}
 
export default CreateUser;
